--Si devono cambiare TUTTI i codici di VV e VB? alcuni sono rimasti con lo 0 in testa!
UPDATE T030_ANAGRAFICO SET COMUNENAS = '1'||SUBSTR(COMUNENAS,2,5) WHERE
COMUNENAS IN (SELECT CODICE FROM T480_COMUNI WHERE PROVINCIA IN ('VB','VV','KR','PO'));

UPDATE T430_STORICO SET COMUNE = '1'||SUBSTR(COMUNE,2,5) WHERE 
COMUNE IN (SELECT CODICE FROM T480_COMUNI WHERE PROVINCIA IN ('VB','VV','KR','PO'));

UPDATE T480_COMUNI SET PROVINCIA = DECODE(PROVINCIA,'PS','PU','FO','FC') WHERE PROVINCIA IN ('PS','FO');

DELETE FROM T480_COMUNI WHERE PROVINCIA IN ('VB','VV','KR','PO');

